import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    Button,Card,CardTitle
} from 'reactstrap';


export default function Pregunta(props) {

    return (
        <div>
            {props.preguns.map((pregunta, index) => (
                   <Card
                   key={index}
                   body
                   className="my-2"
                   style={{
                     width: '18rem'
                   }}
                 >
                    <CardTitle tag="h5">
                        {pregunta.texto}
                    </CardTitle>
                    <br />
                    {pregunta.respuestas.map((respuesta, index) => (
                        <><Button key={index} color='primary'>{respuesta.respuesta}</Button>&nbsp;</>
                    ))}
                </Card>
            ))}
        </div >
    );
}
